body_text:
@cbfinn
In prediction.train.py, explicitly pass in prefix name to Model instance because summary names can no longer take in placeholder strings (at least for now, see tensorflow/models#6603).
In lstm_ops.py, directly use inferred_batch_size because the initializer cannot take shapes made of tensors.

xrange() was removed in Python 3
Also use six to define long in Python 3 in a way that works for linters

@derekjchow Your thoughts on these mods?

If I understand correctly, SyncReplicasOptimizer.make_session_run_hooks output is supposed to be run on every worker, with the provided is_chief flag determining whether aggregation is performed.
This PR fixes that (it also moves other hooks inside the model_fn so that you can refer to logging tensors by reference rather than by name which is fragile).
